import React, { useEffect, useState } from 'react'
import { getGraphData } from '../api'

function GraphChart() {
    const [graphData, setGraphData] = useState([])

    useEffect(() => {
        getGraphData()
            .then(res => {
                console.log("Graph data")
                console.log(res)
            })
        return () => { }
    }, [])
    return (
        <div>GraphChart</div>
    )
}

export default GraphChart
